import classes from "./UserView.module.css"
function UserView({user}){
    return (
      <div className={classes.wrapper}>
        <h1>User info</h1>
        <h2>Name</h2>
        <p>{user.name}</p>
        <h2>Email</h2>
        <p>{user.email}</p>
        <h2>Date</h2>
        <p>{user.birthdate}</p>
        <h2>Department</h2>
        <p>{user.department}</p>
      </div>
    );
}
export default UserView;
